import React from 'react'
import ListGroup from 'react-bootstrap/ListGroup';
const List = () => {

  return (
    <ListGroup defaultActiveKey="#link1">
      <ListGroup.Item active>
        Link 1
      </ListGroup.Item>
      <ListGroup.Item action href="#link2" disabled>
        Link 2
      </ListGroup.Item>
    </ListGroup>
  );
  
};

export default List;
